--
-- Table structure for table `supportcard`
--

DROP TABLE IF EXISTS `supportcard`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `supportcard` (
  `id` int NOT NULL,
  `title` varchar(45) DEFAULT NULL,
  `chara` varchar(45) NOT NULL,
  `chara_id` int NOT NULL,
  `rarity` int DEFAULT NULL,
  `exchange_item_id` int DEFAULT NULL,
  `effect_table_id` int DEFAULT NULL,
  `unique_effect_id` double DEFAULT NULL,
  `command_type` int DEFAULT NULL,
  `command_id` int DEFAULT NULL,
  `support_card_type` int DEFAULT NULL,
  `skill_set_id` int DEFAULT NULL,
  `detail_pos_x` int DEFAULT NULL,
  `detail_pos_y` int DEFAULT NULL,
  `detail_scale` int DEFAULT NULL,
  `detail_rot_z` int DEFAULT NULL,
  `start_date` int DEFAULT NULL,
  `outing_max` int DEFAULT NULL,
  `effect_id` int DEFAULT NULL,
  `jpn_name` varchar(45) NOT NULL,
  `kor_name` varchar(45) NOT NULL,
  `eng_name` varchar(45) NOT NULL,
  PRIMARY KEY (`id`,`chara_id`,`eng_name`,`kor_name`,`jpn_name`,`chara`),
  KEY `uma_idx` (`chara_id`),
  KEY `jp_name_idx` (`chara_id`,`jpn_name`),
  CONSTRAINT `uma` FOREIGN KEY (`chara_id`) REFERENCES `umamusume` (`Order`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

